import '../style.css';
import imagex from './icon_circlex_.png';
import image1 from './image-1.png';
import image2 from './image-2.png';
import vector from './Vector.png';
import React, { useState } from 'react';
import Axios from 'axios';
import { useNavigate } from 'react-router';

function SignUp() {
  const [email, setEmail] = useState('');
  const [name, setName] = useState('');
  const [password, setPassword] = useState('');
  const [gender, setGender] = useState('');
  const [emailExists, setEmailExists] = useState(false); // State to track if email exists
  const [country, setCountry] = useState('');
  const [dob, setDob] = useState('');
  const [height, setHeight] = useState('');
  const [weight, setWeight] = useState('');
  const [lifestyle, setLifestyle] = useState('');
  const [medicalcondition, setMedicalcondition] = useState('');
  const navigate = useNavigate();

  // Function to check if email exists in the database
  const checkEmailExists = async () => {
    try {
      const response = await Axios.post('http://localhost:3002/api/check-email-exists', {
        email: email,
      });

      // If the response indicates that the email exists
      if (response.data.emailExists) {
        setEmailExists(true);
      } else {
        setEmailExists(false);
        // If the email doesn't exist, proceed with registration
        submitPost();
      }
    } catch (error) {
      console.error('Error checking email existence:', error);
      // Handle the error appropriately
    }
  };

  // Function to submit user registration data
  const submitPost = () => {
    Axios.post('http://localhost:3002/api/signup', {
      email: email,
      name: name,
      password: password,
      gender: gender,
      country: country,
      dob: dob,
      height: height,
      weight: weight,
      lifestyle: lifestyle,
      medicalcondition: medicalcondition,
    });
    navigate('/');
  };

  return (
    <div className="sign-up-pop-up">
      <div className="div">
        <div className="text-wrapper">CareCalories.</div>
        <a href="">
          <button className="frame">
            <div className="text-wrapper-2">Sign Up</div>
          </button>
        </a>
        <div className="frame-2">
          <div className="text-wrapper-3">Create your account</div>
          <p className="p">Your healthy life starts here</p>
        </div>
        <div className="frame-3">
          <input
            className="overlap-group"
            placeholder="Full Name"
            type="text" // Change the type to text
            onChange={(e) => {
              setName(e.target.value); // Set the name state
            }}
          />
          <label className="text-wrapper-5">Name*</label>
        </div>
        <div className="frame-4">
          <input
            className="overlap-group"
            placeholder="***********"
            type="text" // Change the type to text
            onChange={(e) => {
              setPassword(e.target.value); // Set the password state
            }}
          />
          <label className="text-wrapper-7">Password*</label>
        </div>
        <div className="frame-5">
          <input
            className="overlap-group"
            placeholder="***********"
            type="text" // Change the type to text
            onChange={(e) => {
              // You can handle re-type password here if needed
            }}
          />
          <label className="text-wrapper-8">Re-Type Password*</label>
        </div>
        <div className="frame-6">
          <input
            className="overlap-group"
            placeholder="DD/MM/YYYY"
            type="text" // Change the type to text
            onChange={(e) => {
              setDob(e.target.value); // Set the dob state
            }}
          />
          <label className="text-wrapper-10">Date of Birth*</label>
        </div>
        <div className="overlap">
          <div className="frame-7">
            <div className="overlap-2">
              <input
                type="text" // Change the type to text
                className="rectangle"
                placeholder="70"
                onChange={(e) => {
                  setWeight(e.target.value); // Set the weight state
                }}
              />
              <div className="text-wrapper-12">Kgs</div>
            </div>
            <label className="text-wrapper-13">Weight*</label>
          </div>
          <div className="text-wrapper-14">cm</div>
          <div className="frame-8">
            <input
              className="div-wrapper"
              placeholder="171"
              type="text" // Change the type to text
              onChange={(e) => {
                setHeight(e.target.value); // Set the height state
              }}
            />
            <label className="text-wrapper-16">Height*</label>
          </div>
        </div>
        <div className="frame-9">
          <select
            className="overlap-group"
            onChange={(e) => {
              setCountry(e.target.value); // Set the country state
            }}
          >
            <option>Singapore</option>
            <option>Malaysia</option>
            <option>Indonesia</option>
          </select>
          <img className="vector" alt="Vector" src={vector} /> {/* Move the <img> tag here */}
          <label className="text-wrapper-18">Country*</label>
        </div>
        <div className="frame-10">
          <input
            type="text" // Change the type to text
            className="overlap-group"
            placeholder="Normal"
            onChange={(e) => {
              setMedicalcondition(e.target.value); // Set the medicalcondition state
            }}
          />
          <label className="text-wrapper-19">Medical Condition*</label>
        </div>
        <div className="frame-11">
          <input
            className="overlap-group"
            placeholder="name@example.com"
            type="text" // Change the type to text
            onChange={(e) => {
              setEmail(e.target.value); // Set the email state
            }}
          />
          <label className="text-wrapper-21">Email*</label>
        </div>
        <div className="frame-12">
          <select
            className="overlap-3"
            onChange={(e) => {
              setGender(e.target.value); // Set the gender state
            }}
          >
            <option>Male</option>
            <option>Female</option>
            <option>Prefer Not to Say</option>
            {/* You might want to remove this <img> tag */}
          </select>
          <label className="text-wrapper-16">Gender*</label>
        </div>
        <div className="frame-13">
          <select
            className="overlap-4"
            onChange={(e) => {
              setLifestyle(e.target.value); // Set the lifestyle state
            }}
          >
            <option>Not Active(0-1 times a week)</option>
            <option>Active(1-2 times a week)</option>
            <option>Very Active(More than 3 times a week)</option>
            {/* You might want to remove this <img> tag */}
          </select>
          <div className="overlap-5">
            <label className="text-wrapper-24">Lifestyle*</label>
          </div>
        </div>
        <a href="">
          <img className="icon-circle-x" alt="Icon circle x" src={imagex} />
        </a>
        <div className="overlap-6">
          <img className="image" alt="Image" src={image1} />
          <img className="image-2" alt="Image" src={image2} />
        </div>
      </div>
    </div>
  );
}

export default SignUp;
